import React from 'react';
import { Switch, Route, Link } from 'react-router-dom'; // Import necessary components

// Import your component definitions (e.g., HomePage, AboutPage)
import HomePage from './HomePage'; // Assuming components are in the same directory
import AboutPage from './AboutPage';

function App() {
  return (
    <div>
      {/* Navigation bar for user-friendly routing */}
      <nav>
        <Link to="/">Home</Link>
        <Link to="/about">About</Link>
        {/* Add links for other routes as needed */}
      </nav>

      {/* Routing logic using Switch and Route */}
      <Switch>
        <Route exact path="/" component={HomePage} />
        <Route path="/about" component={AboutPage} />
        {/* Add additional routes */}
      </Switch>
    </div>
  );
}

export default App;
